class Solution {
  int maximumScore(List<int> nums, int k) {
    const int mod = 1000000007;
    List<int> primeScores = nums.map((x) => _primeScore(x)).toList();
    List<int> sortedIndices = List<int>.generate(nums.length, (i) => i);
    sortedIndices.sort((a, b) => primeScores[b].compareTo(primeScores[a]) != 0 ? primeScores[b].compareTo(primeScores[a]) : nums[b].compareTo(nums[a]));
    int score = 1;
    for (int i = 0; i < k; i++) {
      score = (score * nums[sortedIndices[i]]) % mod;
    }
    return score;
  }

  int _primeScore(int x) {
    int count = 0;
    for (int i = 2; i * i <= x; i++) {
      if (x % i == 0) {
        while (x % i == 0) {
          x ~/= i;
        }
        count++;
      }
    }
    if (x > 1) count++;
    return count;
  }
}
